import Grid from "@mui/material/Grid";
import Typography from "@mui/material/Typography";
import Box from "@mui/material/Box";
import Stack from "@mui/material/Stack";
import Container from "@mui/material/Container";
import TravelExploreIcon from "@mui/icons-material/TravelExplore";
import AppRegistrationIcon from "@mui/icons-material/AppRegistration";

const HeroSection = () => {
    return (
        <Box sx={{ py: 8, position: "relative" }} id="herosection">
            {/* Background Image */}
            <Box
                component="img"
                src="/back.png"  // Path to the public folder image
                alt="Hero Background"
                sx={{
                    width: "100%",
                    height: { xs: "300px", sm: "500px" },
                    objectFit: "cover",
                    objectPosition: "center",
                    mb: 4,
                }}
            />

            <Container maxWidth="lg">
                <Grid container spacing={5} alignItems="center" justifyContent="center">
                    {/* Right Side: Content */}
                    <Grid item xs={12} md={6}>
                        <Typography
                            variant="h4"
                            component="h2"
                            sx={{ fontWeight: "bold", mb: 3, color: "#363636", textAlign: { xs: "center" } }}
                        >
                            Welcome to Alkebuleum
                        </Typography>

                        {/* Description Content */}
                        <Typography
                            variant="body1"
                            color="textSecondary"
                            sx={{ mb: 4, lineHeight: 1.7, textAlign: { xs: "center" } }}
                        >
                            Pan-African Blockchain network powering decentralized applications that address real-world challenges.
                        </Typography>

                        {/* List of Square Buttons with Hover Effect */}
                        <Stack direction="row" spacing={2} justifyContent="center" sx={{ mt: 4 }}>
                            {/* Button 1: Get AKE */}
                            <a href="https://your-get-ake-link.com" style={{ textDecoration: 'none' }}>  {/* Replace with actual link */}
                                <Box
                                    sx={{
                                        display: "flex",
                                        flexDirection: "column",
                                        alignItems: "center",
                                        borderRadius: "16px",
                                        border: "2px solid #D0E9EF", // Outline color (beige-brown)
                                        padding: 2,
                                        width: 120, // Reduced size
                                        height: 120, // Reduced size
                                        textAlign: "center",
                                        backgroundColor: "transparent", // No background color
                                        transition: "all 0.3s ease", // Smooth transition
                                        "&:hover": {
                                            backgroundColor: "#f9d0ba", // Change background on hover
                                            color: "#fff", // Change text color on hover
                                        },
                                    }}
                                >
                                    {/* Embedded SVG for AKE Logo */}
                                    <svg
                                        xmlns="http://www.w3.org/2000/svg"
                                        viewBox="0 0 651.000000 938.000000"
                                        preserveAspectRatio="xMidYMid meet"
                                        width="35"
                                        height="35"
                                        fill="#A97855"  // Apply color here
                                        style={{ marginBottom: "8px" }}
                                    >
                                        <g transform="translate(0.000000,938.000000) scale(0.100000,-0.100000)">
                                            <path d="M3060 9190 c-185 -39 -247 -72 -895 -470 -441 -271 -739 -453 -1080
    -656 -507 -302 -574 -345 -641 -411 -157 -157 -251 -320 -305 -533 l-24 -95 0
    -2320 0 -2320 23 -88 c43 -162 100 -277 209 -423 112 -151 206 -223 648 -499
    159 -99 555 -353 1130 -723 418 -269 532 -341 631 -396 272 -153 520 -182 790
    -91 129 43 264 111 462 232 86 53 283 172 437 266 154 94 413 253 575 355 162
    102 399 248 525 325 332 202 414 258 504 343 129 122 208 256 259 444 l27 95
    5 2345 c3 1290 2 2383 -2 2430 -18 218 -138 471 -302 636 -100 100 -184 155
    -846 554 -349 210 -752 453 -895 539 -620 375 -732 431 -934 466 -108 19 -196
    18 -301 -5z"/>
                                            <path d="M308 476 c120 -24 173 -50 424 -206 319 -199 1279 -788 1521
    -933 154 -93 194 -122 185 -131 -7 -6 -125 -78 -263 -159 -137 -82 -511 -304
    -830 -495 -1181 -706 -1152 -690 -1196 -690 -22 0 -50 6 -62 14 -119 75 -558
    341 -932 566 -1003 604 -1255 758 -1255 768 1 4 42 31 93 61 51 30 200 121
    332 201 132 81 373 228 535 327 162 99 408 250 545 335 355 219 481 292 550
    317 116 42 230 50 353 25z"/>
                                        </g>
                                    </svg>
                                    <Typography variant="body2" fontWeight="bold" color="#A97855">
                                        Get AKE
                                    </Typography>
                                </Box>
                            </a>

                            {/* Button 2: Block Explorer */}
                            <a href="https://your-block-explorer-link.com" style={{ textDecoration: 'none' }}> {/* Replace with actual link */}
                                <Box
                                    sx={{
                                        display: "flex",
                                        flexDirection: "column",
                                        alignItems: "center",
                                        borderRadius: "16px",
                                        border: "2px solid #D0E9EF", // Outline color (beige-brown)
                                        padding: 2,
                                        width: 120, // Reduced size
                                        height: 120, // Reduced size
                                        textAlign: "center",
                                        backgroundColor: "transparent", // No background color
                                        transition: "all 0.3s ease", // Smooth transition
                                        "&:hover": {
                                            backgroundColor: "#f9d0ba", // Change background on hover
                                            color: "#fff", // Change text color on hover
                                        },
                                    }}
                                >
                                    <TravelExploreIcon sx={{ fontSize: 35, color: "#A97855", mb: 1 }} /> {/* Dark brown color */}
                                    <Typography variant="body2" fontWeight="bold" color="#A97855">
                                        Block Explorer
                                    </Typography>
                                </Box>
                            </a>

                            {/* Button 3: Try Apps */}
                            <a href="https://your-try-apps-link.com" style={{ textDecoration: 'none' }}> {/* Replace with actual link */}
                                <Box
                                    sx={{
                                        display: "flex",
                                        flexDirection: "column",
                                        alignItems: "center",
                                        borderRadius: "16px",
                                        border: "2px solid #D0E9EF", // Outline color (beige-brown)
                                        padding: 2,
                                        width: 120, // Reduced size
                                        height: 120, // Reduced size
                                        textAlign: "center",
                                        backgroundColor: "transparent", // No background color
                                        transition: "all 0.3s ease", // Smooth transition
                                        "&:hover": {
                                            backgroundColor: "#f9d0ba", // Change background on hover
                                            color: "#fff", // Change text color on hover
                                        },
                                    }}
                                >
                                    <AppRegistrationIcon sx={{ fontSize: 35, color: "#A97855", mb: 1 }} /> {/* Dark brown color */}
                                    <Typography variant="body2" fontWeight="bold" color="#A97855">
                                        Try Apps
                                    </Typography>
                                </Box>
                            </a>
                        </Stack>
                    </Grid>
                </Grid>
            </Container>
        </Box>
    );
};

export default HeroSection;
